import { Row, Col } from "react-bootstrap";
import ActionButton from "src/Components/UI/ActionButton/ActionButton";
import CButton from "src/Components/UI/Button/Button";
import { FormInput } from "src/Components/UI/Input/FormInput";

const AddOrderItem = () => {
  return (
    <Row>
      <FormInput type="text" label="Product Name" readOnly={false} size={4} />
      <FormInput type="number" label="Quantity" readOnly={false} size={2} />
      <Col md={2}>
        <ActionButton
          value="Assign Roles"
          name="cil-align-center"
          
        />
      </Col>
    </Row>
  );
};
export default AddOrderItem;
